import React, { useState, useEffect } from 'react';

function Home(handleLogout){
    function handleLogout() {
        fetch("/logout", {
          method: "DELETE",
        }).then(handleLogout);
      }
    return (
        <header>
        <button onClick={handleLogout}>Logout</button>
      </header>
    )
}

export default Home;
